import React from "react";
import styles from './users.module.css';

let Users = (props) => {

    props.setUsers([{
        id: 1,
        photoURL: 'https://img.discogs.com/6YYwycf4jYbS66ima5GRrQ_Zuys=/fit-in/300x300/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1187234-1217993135.jpeg.jpg',
        fullName: 'Tim',
        followed: false,
        status: 'Hamburgers and hot-dogs too, I wanna have a BBQ',
        location: {city: 'Los-Angeles', country: 'USA'}
    },
        {
            id: 2,
            photoURL: 'https://pbs.twimg.com/media/A8VdAmLCUAAk05D.jpg',
            fullName: 'Eric',
            followed: true,
            status: 'I like parties, I like fun, I wanna live in a hamburger bun',
            location: {city: 'Los-Angeles', country: 'USA'}
        },
        {
            id: 3,
            photoURL: 'https://images.shazam.com/coverart/t209394323-i695242490_s400.jpg',
            fullName: 'DJ Douggpound',
            followed: true,
            status: 'Are you ready for the remix?',
            location: {city: 'Los-Angeles', country: 'USA'}
        },
        {
            id: 4,
            photoURL: 'https://www.pedestrian.tv/content/uploads/2015/08/SteveBrule-619-386.jpg',
            fullName: 'Dr.Steve Brule',
            followed: false,
            status: 'For your health!',
            location: {city: 'Los-Angeles', country: 'USA'}
        },
        {
            id: 5,
            photoURL: 'https://i.pinimg.com/originals/39/56/03/39560349986041d872bbf4f5e28df1eb.jpg',
            fullName: 'Andre',
            followed: false,
            status: 'Do you believe in da lies of society?!',
            location: {city: 'Los-Angeles', country: 'USA'}
        }])

    return <div>
        {
            props.users.map( u => <div key={u.id}>
                <span>
                    <div>
                        <img src={u.photoURL} className={styles.userPhoto} />
                    </div>
                    <div>
                        {u.followed
                            ? <button onClick={ () => {props.unfollow(u.id)} }>Unfollow</button>
                            : <button onClick={ () => {props.follow(u.id)} }>Follow</button>}
                    </div>
                </span>
                <span>
                    <span>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </span>
                    <span>
                        <div>{u.location.country}</div>
                        <div>{u.location.city}</div>
                    </span>
                </span>
            </div>)
        }
    </div>
}

export default Users;
